import React from "react";
import Footer from "react-bootstrap/Navbar";
import {Container, Nav} from "react-bootstrap";
// import axios from "axios";
import "./siteMap.css";

const SiteMap = () => {
    return (
    <Container>
        <Nav className="mr-auto">

        <Nav.Item title="About Me" id="basic-nav-dropdown" href="">About Me
            <Nav.Link href="">Introduction</Nav.Link>
            <Nav.Link href="">Education </Nav.Link>
            <Nav.Link href="">Work Experience </Nav.Link>
            <Nav.Link href="">Interests </Nav.Link>
            </Nav.Item>


          <Nav.Item title="Projects" id="basic-nav-dropdown" href="">Projects
            <Nav.Link href="">Individual Projects</Nav.Link>
            <Nav.Link href="">Group Projects</Nav.Link></Nav.Item>

          <Nav.Item title="Contact" id="basic-nav-dropdown" href="">Contact
            <Nav.Link href="">My Info</Nav.Link>
            <Nav.Link href="">Message Me</Nav.Link></Nav.Item>

          </Nav> 
      </Container>
    )
}
export default SiteMap;
